"use strict";

const { Counter } = require('collections');
function f_gold(nums, k) {
    let ans = 0, s = 0;
    let counter = new Counter({0: 1});
    for (let num of nums) {
        s += num;
        ans += counter.get(s % k);
        counter.set(s % k, counter.get(s % k) + 1);
    }
    return ans;
}
